import {React, useContext} from "react";
//components
import User from "../../components/User/index.js";
import Payment from "../../components/Payment/index.js";

//styles
import { Wrapper, Content, UserInfoContainer, PaymentContainer } from "./Form.styles.js";

const Account = () => {

	return (
		<Wrapper>
			<Content>
				<UserInfoContainer> <User> </User> ONE MORE </UserInfoContainer>
				<PaymentContainer><Payment></Payment></PaymentContainer>	

			</Content>
		</Wrapper>
	);
}

export default Account
